/*javascript for photo gallery starts here*/


(function ($) {
	// ImageGallery
	$.fn.corningImageGallery = function(options) {
		var options = options || {},
			$el = $(this),
			screenWidth = $(window).width(),
			device = (screenWidth > 767) ? 'desktop' : 'mobile' ,
			totalLength = 0,
			jsonData = options.galleryJSON;

		function _paintSlider() {
			var slider = $el.find('ul.gallery');
			
			$(slider).empty();

			$.each(jsonData.imagesInfo, function(index, val) {
				var nextIndex = index+1;
				var listData = "<li index= "+index+" data-mobile='" + val.bigImageURL + "/jcr:content/renditions/thumbnail_155." + val.extension + "' " +
                                	"data-mobile-landscape='" + val.bigImageURL + "/jcr:content/renditions/thumbnail_155." + val.extension + "' " +
                                	"data-tablet='" + val.bigImageURL + "/jcr:content/renditions/thumbnail_155." + val.extension + "' " +
                                	"data-tablet-landscape='" + val.bigImageURL + "/jcr:content/renditions/thumbnail_155." + val.extension + "' " +
                                	"data-retina='" + val.bigImageURL + "/jcr:content/renditions/thumbnail_155." + val.extension + "' " +
                                	"data-retina-portrait='" + val.bigImageURL + "/jcr:content/renditions/thumbnail_155." + val.extension + "' " +
									"data-thumb='" + val.bigImageURL + "/jcr:content/renditions/thumbnail_155." + val.extension + "' " +
                                	"data-desktop='" + val.bigImageURL + "/jcr:content/renditions/thumbnail_155." + val.extension + "' data-index='" + index+ "'>" +
                                "<div class='image-info'>" +
                                	"<a href='#' class='Analytics-Images' data-imageName='"+ val.imageHeader+"' data-slider='slider-" + nextIndex + "'></a>" +
                                    "<h3>" + val.imageHeader + "</h3>" +
                                    "<p>" + val.imageDescription + "</p>" +
                                "</div>" +
                                "<img src='" + designPath + "/resources/images/global/spacer.png' " +
                                	"data-mobile='" + val.bigImageURL + "/jcr:content/renditions/mobile_320." + val.extension + "' " +
                                	"data-mobile-landscape='" + val.bigImageURL + "/jcr:content/renditions/mobile_480." + val.extension + "' " +
                                	"data-tablet='" + val.bigImageURL + "/jcr:content/renditions/tablet_606." + val.extension + "' " +
                                	"data-tablet-landscape='" + val.bigImageURL + "/jcr:content/renditions/tablet_711." + val.extension + "' " +
                                	"data-retina='" + val.bigImageURL + "/jcr:content/renditions/retina_1422." + val.extension + "' " +
                                	"data-retina-portrait='" + val.bigImageURL + "/jcr:content/renditions/retina_1212." + val.extension + "' " +
                                	"data-desktop='" + val.bigImageURL + "/jcr:content/renditions/desktop_711." + val.extension + "' " +
                                	"class='lazyload' alt = '" + val.imageAltText + "'/> " +
                                "</li>" ;
                totalLength += 1;
                $(slider).append(listData);
			})
			_initializeSlider();
			_handleImageDetails();
			_handleNextPrevSlide();
            responsiveImagefiller();
            $('.lazyload').each(function(i, elm){
                activateVisiblePicturefills(elm);
            });
            $(window).resize(function(){
                device = ($(window).width() > 767) ? 'desktop' : 'mobile';
                _initializeSlider();
            });
		}

		function _initializeSlider() {
			$el.flexslider({
		        animation: "slide",
		        controlNav: false,
		        animationLoop: false,
		        slideshow: false,
		        directionNav: true,
		        controlNav: "thumbnails",
                keyboard: false
		    });
			if (device == 'desktop') {
				$el.find(".flex-control-nav").customScrollbar({
				  	skin: "corning-custom-skin",
				  	hScroll: false,
				  	updateOnWindowResize: true
				});
			} else {
				$el.find(".flex-control-nav").customScrollbar({
				  	skin: "corning-custom-skin",
				  	vScroll: false,
				  	hScroll: true,
				  	updateOnWindowResize: true
				});
			}
		}

		function _handleImageDetails() {

			$el.on('click', '.image-info > a', function (event) {
				event.preventDefault();
				var self = $(this).parents('.image-info');
				(self.hasClass('open')) ? self.removeClass('open') : self.addClass('open');
			});
            $('.gallery-slider').bind('click', function(){
                if($('.gallery-slider').find('.flex-active-slide .image-info.open').length>0){
                    $('.gallery-slider').find('.flex-direction-nav').css({'top' : '20%'});
                }
                else {
                    $('.gallery-slider').find('.flex-direction-nav').css({'top' : ''});
                }
                
            });

			$el.find('.flex-prev').parent().addClass('first').siblings().addClass('last');
			$el.find('.flex-control-thumbs .flex-active').parent().addClass('selected');
			$el.on('click', '.flex-control-thumbs .flex-active', function (event) {
				$(this).parent().addClass('selected').siblings().removeClass('selected');
			})

		}

		function _handleNextPrevSlide() {
			var prevSelectedSlideIndex = 0;
			$el.find('.flex-direction-nav').on('click', 'li a', function (event) {
				var selectedSlideIndex = $el.find('.slides').find('.flex-active-slide').data('index');
				if (selectedSlideIndex == prevSelectedSlideIndex)
					return false;
				prevSelectedSlideIndex = selectedSlideIndex;

				$el.find('.flex-control-nav').find('.viewport li').removeClass('selected');
				var selectedLi = $el.find('.flex-control-nav').find('.viewport li')[selectedSlideIndex];
				$(selectedLi).addClass('selected');
			})
		}

		function _init() {
			if ('undefined' != typeof(jsonData) && 'undefined' != typeof(jsonData.imagesInfo) && jsonData.imagesInfo != undefined) {
				_paintSlider();
			}
		}

		_init();
	}

})(jQuery);


//if a gallery is on the page
if( $('.gallery-slider').length ) {

	//cache the selector
	var $gallerySliders = $('.gallery-slider');

	//loop over them via each loop if we have multiple on a page
	$gallerySliders.each(function(index,val){
		//cache this elem in the loop
		var $this = $(this);
		//store the slide obj in a var
		var elemData = $this.find('.gallery').data('slides');
		//assign method
		$this.corningImageGallery({
			galleryJSON : elemData
		})
	})
	
}


