// Height calculation
function resizerelateddocuments() {
    var maxHeight = 0;
    var heightofItem;
    $('.module-product-related-documents .document-col').css('height', 'auto');
    $('.module-product-related-documents .document-col').each(function() {
        heightofItem = $(this).height();
        if (heightofItem > maxHeight) {
            maxHeight = heightofItem;
        }

    });
    $('.module-product-related-documents .document-col').height(maxHeight);
}

