$(window).load(function(){
    var scrollTimer;
    if(navigator.userAgent.toLowerCase().indexOf('ipad')>-1 && $('.module-sharing-tools').length>0)
    {
        socialSharingPositionHandler();
        $(window).scroll(function(){
            $('.module-sharing-tools').hide();
            clearTimeout(scrollTimer);
            scrollTimer = setTimeout(socialSharingPositionHandler, 100);
        });
        $(window).resize(socialSharingPositionHandler);
    }
});

function socialSharingPositionHandler(){
    var topPosition, marginAdjust = 0;
    if($('html').hasClass('menu-active')){
        marginAdjust = -parseInt($('body').css('margin-top'), 10);
        marginAdjust-=45;
    }
    else {
        marginAdjust = 0;
    }
    if($(window).width()<980)
    {
        topPosition = $(window).scrollTop() + window.innerHeight + marginAdjust - $('.module-sharing-tools').height(); 
    }
    else {
        topPosition = $(window).scrollTop() + window.innerHeight*0.3 + marginAdjust;
    }
    $('.module-sharing-tools').css({'top': topPosition+'px',
                                    'position' : 'absolute'});
    $('.module-sharing-tools').fadeIn();
}
