// Show less and show more functionality

function loadEvents(){
    size_li = $("#carouselItems li").size();
    x=3;
    $('#carouselItems li:lt('+x+')').show();
    $('#loadMore').click(function () {
        x= (x+25 <= size_li) ? x+25 : size_li;
        $('#carouselItems li:lt('+x+')').show();
         $('#showLess').show();
        if(x == size_li){
            $('#loadMore').hide();
        }
    });
    $('#showLess').click(function () {
        x=(x-25<0) ? 3 : x-25;
        $('#carouselItems li').not(':lt('+x+')').hide();
        $('#loadMore').show();
         $('#showLess').show();
        if(x == 3){
            $('#showLess').hide();
        }
    });
}

