/**
 * Randomize array element order in-place.
 * Using Durstenfeld shuffle algorithm.
 */
function shuffleArray(array) {
    for (var i = array.length - 1; i > 0; i--) {
        var j = Math.floor(Math.random() * (i + 1));
        var temp = array[i];
        array[i] = array[j];
        array[j] = temp;
    }
    return array;
}

function loadBanner(){
    //Show after all images have loaded
    // $('.banner').show();

    if( $('.secondary-navigaiton').length > 0 ){
        $('.banner').addClass('has-secondary-navigation');
    }

    //Stick the modal to the bottom of the page for zindex
    // var $videoModals = $('[data-video][data-video-modal]').detach();
    // $('body').append($videoModals);
    // Check to see if background video is paused, and playing if it is.
    var videoBackground = document.querySelector('.banner-video-background--video');
    if (videoBackground && videoBackground.paused === true) videoBackground.play();

    var $bannerItem = $('.banner--multiple').find('.banner-item');

    if ($bannerItem.length > 1 && bannerComponentValues.order == "randomize") {
        var shuffled = shuffleArray($bannerItem);
        $('.banner--multiple').empty().append(shuffled);
    }

    if ($bannerItem.length > 1 && bannerComponentValues.order == "reindex") {
        var order = [];

        for(var i = 0; i < $bannerItem.length; i++){
            //console.log(bannerComponentValues.reindex[i+1]);
            order.push(bannerComponentValues.reindex[i+1]);
        }

        //console.log(order);

        var elements = [];
        for(var i = 0; i < order.length; i++){
            //console.log(i);
            //console.log(order[i]-1);
            elements.push($bannerItem.get(order[i]-1));
        }

        $('.banner--multiple').empty().append(elements);

        // load iframes with embedded video players
    }

    $('.banner-item').each(function(index,val){
        //Add this for analytics, it will cover all 3 options for "sorting" and fires after the client side sorts
        var count = index+1;
        $(this).find('.Analytics-Banner').attr('data-slider', 'slider-'+count);
        //Show everything, initially hiding all but the first while everything loads
        $(this).show();
    });

    $('.banner--multiple').each(function(index,val) { //loop through all possible banners on a page though should only be one
        var _el = $(this);
        _el.css('display', 'block');
        _el.not('.slick-initialized').slick({ //trigger slick
            infinite: true,
            slide: '.banner-item',
            fade: true,
            dots: true,
            adaptiveHeight: false,
            autoplaySpeed: bannerComponentValues.speed,
            slidesToShow: 1,
            slidesToScroll: 1,
            autoplay: bannerComponentValues.autoplay,
            useTransform: false,
            pauseOnHover: false
        });
    });

}

if($('.banner').length > 0){
    // $('.banner').hide();
    // $(window).on('load', function(){
    //     $('.module-loading').remove();
    // });
    $(window).on('load', loadBanner);
}

