$(document).ready(function() {
  $('.portal-contact-us .region-select').on('change', function() {
    var $this = $(this);
    var $portalContactUs = $this.closest(".portal-contact-us");
    $portalContactUs.find('.region-list .region').addClass('hidden');
    $portalContactUs.find('.region-image .region').addClass('hidden');
    $portalContactUs.find('[data-region="' + $this.val() + '"]').removeClass('hidden');
  });
});

$(window).on('load resize', function() {
    if ($(window).width() > 1024) {
        var navItemHeight = 0;
        $('#site-nav .subnav li').each(function() {
            if ($(this).height() > navItemHeight) {
                navItemHeight = $(this).height()
            }
        });
        $('#site-nav .subnav li a').css('height', navItemHeight);
    } else {
        $('#site-nav .subnav li a').css('height', 'auto')
    }
    
    
})
var IOS = (navigator.userAgent.match(/(iPad|iPhone|iPod)/g) ? true : false);

function resizeIframe(){
    var mobileHeight = $('.open-module').data('mobile-height'),
        tabletHeight = $('.open-module').data('tablet-height'),
        desktopHeight = $('.open-module').data('desktop-height'),
        openModuleFrame = $('.open-module-iframe'),
        iframeWrapper = $('#iframeWrapper');

    if (($(window).width() >= 320) && ($(window).width() < 768)) {
        $(iframeWrapper).height(mobileHeight);
        $(openModuleFrame).height(mobileHeight);
    } else if (($(window).width() >= 768) && ($(window).width() < 1023)) {
        $(iframeWrapper).height(tabletHeight);
        $(openModuleFrame).height(tabletHeight);
    } else {
        $(iframeWrapper).height(desktopHeight);
        $(openModuleFrame).height(desktopHeight);
    }
}

$(document).ready(function(){
    resizeIframe();
    if(IOS){
        if($('.open-module-iframe').length){
            if($('.open-module-iframe').attr("src").indexOf("GlassStack") > 0){
                $('.open-module-iframe').prop('scrolling', 'no');
            }
        }
    }
});
